//     "body_html": "<p><span style=\"font-weight: 400;\">In the far corners and out-of-the-way paths of Hazel Village, Annicke Mouse likes to inspect the trails and leave messages for herself in the form of “trail trinkets.” She says this one means, “This is a great place to watch a rainstorm, if you don’t mind getting a bit damp. Also, look out for nettles.”</span></p>\n<meta charset=\"utf-8\">\n<p><span>This is a fine art print of Jane's original watercolor painting. It's 10\" x 10\", printed on acid-free, 100% recycled card stock. </span></p>\n<p>For every print we sell, we are planting a tree. So if you hang this print in a child's room, the tree will probably be big when the child is. Which is a situation that makes the animals very happy.</p>",
